import React from 'react';
import {Menu} from 'semantic-ui-react';

const PageHeader = () => {
<div>
    <Menu pointing secondary>
        <Menu.Item name='Industry Background'/>
        <Menu.Item name='Threat Modelling'/>
        <Menu.Item name='About Us'/>
    </Menu>
</div>

}
export default PageHeader;
